import React from 'react';

import { TouchableOpacity } from 'react-native';

import {
    Card,
    Icon,
    CardHeader,
    EventImage,
    Hold,
    TitleHeart,
    CardTitle,
    CardInfo,
    Date,
    Hour,
    Payment,
    Footer,
    FooterText,
    HourIcon,
    PaymentIcon,
    DateIcon
} from './styles';

interface CardProps {
    title: string;
    dateInfo: string;
    hourInfo: string;
    paymentInfo: string;
    footerText: string;
    isActiveIcon: boolean;
    handleChangeIcon: () => void;
}

export function EventCard( { 
    title, 
    dateInfo, 
    paymentInfo, 
    hourInfo, 
    footerText, 
    isActiveIcon, 
    handleChangeIcon 
}: CardProps ) {

    return (
        <Card>
            <CardHeader>
                <EventImage
                    source={{uri: 'https://avatars.githubusercontent.com/u/55644267?v=4'}}
                />
                <Hold>
                    <TitleHeart>
                        <CardTitle>{title}</CardTitle>

                        <TouchableOpacity onPress={handleChangeIcon}>
                            <Icon isActiveIcon={isActiveIcon} name='heart'/>
                        </TouchableOpacity>    

                    </TitleHeart>
                    <CardInfo>
                        <Date dateinfo={dateInfo}>
                            <DateIcon name="calendar-blank"  />

                        </Date>
                        <Hour>
                            <HourIcon name="clock-outline" />   
                            {/* {hourInfo} */}
                        </Hour>
                        <Payment>
                            <PaymentIcon name="currency-usd" />
                            {/* {paymentInfo} */}
                        </Payment>
                    </CardInfo>
                </Hold>
            </CardHeader>
            <Footer>
                <FooterText>
                    {footerText}
                </FooterText>
            </Footer>
        </Card>
    )
}
